def box_plot_total_cost(ax, m, y1, y2, y3, y4, y5, y6):
    dic={
        'algorithms': ['BRA'] + ['IP'] + ['SW'] + ['LF']+['FF']+['BF'],
        'energy': [sum(y1) / 100] + [sum(y2) / 100] + [y3] + [y4] + [y5] + [y6]
    }
    df=pd.DataFrame(dic)
    sns.barplot(x='algorithms', y='energy', data=df, ax=ax)
    ax.set_xticklabels(['BRA', 'IP', 'SW', 'LF', 'FF', 'BF'])
    ax.set_xlabel(str(m) + " different servers ", fontsize=16)
    ax.set_ylim(20000,)


def barplot_avg_time(ax, n, m, t1, t2, t3, t4, t5, t6):
    dic={
        'agent': ['Agent ' + str(i + 1) for i in range(n)] * 6,
        'time': t1 + t2 + t3 + t4 + t5 + t6,
        'algorithm': ['BRA'] * 8 + ['IP'] * 8 + ['SW'] * 8 + ['LF'] * 8 + ['FF'] * 8 + ['BF'] * 8
    }
    df=pd.DataFrame(dic)
    g=sns.barplot(x='agent', y='time', hue='algorithm', data=df, ax=ax)
    ax.set_xticklabels(['Agent ' + str(i + 1) for i in range(n)], fontsize=10)
    ax.set_xlabel(str(m) + " different servers", fontsize=16)
    ax.set_ylabel("")
    ax.set_ylim(0, 1)
    ax.legend(loc='lower center', ncol=3, framealpha=2, fontsize=10)


def total_cost():
    # sns.set(palette="hls", color_codes=True)
    f, axes = plt.subplots(2, 2, sharex=True)

    box_plot_total_cost(axes[0, 0], 4, y1_4, y2_4, y3_4, y4_4, y5_4, y6_4)
    axes[0, 0].set_ylabel("")
    box_plot_total_cost(axes[0, 1], 11, y1_11, y2_11, y3_11, y4_11, y5_11, y6_11)
    axes[0, 1].set_ylabel("")
    box_plot_total_cost(axes[1, 0], 21, y1_21, y2_21, y3_21, y4_21, y5_11, y6_11)
    axes[1, 0].set_ylabel("")
    box_plot_total_cost(axes[1, 1], 36, y1_36, y2_36, y3_36, y4_36, y5_36, y6_36)
    axes[1, 1].set_ylabel("")
    plt.suptitle("Total Cost of Each Algorithm", y=0.95, fontsize=16)
    plt.subplots_adjust(wspace=0.3, hspace=0.2)
    plt.savefig("total_cost.eps")
    plt.show()


def resp_time():
    f, axes=plt.subplots(2, 1, sharex=True)
    barplot_avg_time(axes[0], 8, 4, t1__4, t2__4, t3__4, t4__4, t5__4, t6__4)
    barplot_avg_time(axes[1], 8, 11, t1__11, t2__11, t3__11, t4__11, t5__11, t6__11)
    f.suptitle("Average response time of each agent", x=0.05, y=0.9, fontsize=15, rotation=90)
    plt.savefig("resp_time.eps")
    plt.show()



def compute_fairness(t):
    return sum(t) ** 2 / (len(t) * sum([i ** 2 for i in t]))


def fairness():
    f1=[compute_fairness(t) for t in [t1__4, t2__4, t3__4, t4__4, t5__4, t6__4]]
    f2=[compute_fairness(t) for t in [t1__11, t2__11, t3__11, t4__11, t5__11, t6__11]]
    f3=[compute_fairness(t) for t in [t1__21, t2__21, t3__21, t4__21, t5__21, t6__21]]
    f4=[compute_fairness(t) for t in [t1__36, t2__36, t3__36, t4__36, t5__36, t6__36]]
    dic={
        'fairness': f1 + f2 + f3 + f4,
        'algorithm': ['BRA', 'IP', 'SW', 'LF', 'FF', 'BF'] * 4,
        'server number': [4] * 6 + [11] * 6 + [21] * 6 + [36] * 6
    }
    df=pd.DataFrame(dic)
    fig=plt.figure()
    ax = fig.add_subplot(111)

    sns.barplot(x='server number', y='fairness', data=df, hue='algorithm', ax=ax)
    plt.xticks(fontsize=16)
    plt.yticks(fontsize=16)
    ax.set_xlabel('Server number', fontsize=16)
    ax.set_ylabel('Fairness index', fontsize=16)
    plt.legend(loc='lower center', ncol=3, framealpha=1, title='Algorithm', fontsize=12)
    plt.savefig("sim_fairness.eps")
    plt.show()


def qos_violation():
    q4 = [sum(qos4[0])/100, sum(qos4[1])/100, qos4[2], qos4[3], qos4[4], qos4[5]]
    q11 = [sum(qos11[0])/100, sum(qos11[1])/100, qos11[2], qos11[3], qos11[4], qos11[5]]
    q21 = [sum(qos21[0])/100, sum(qos21[1])/100, qos21[2], qos21[3], qos21[4], qos21[5]]
    q36 = [sum(qos36[0])/100, sum(qos36[1])/100, qos36[2], qos36[3], qos36[4], qos36[5]]
    dic = {
        'qos': q4 + q11 + q21 + q36,
        'algorithm': ['BRA', 'IP', 'SW', 'LF', 'FF', 'BF'] * 4,
        'server number': [4] * 6 + [11] * 6 + [21] * 6 + [36] * 6,
    }
    df = pd.DataFrame(dic)
    f, ax = plt.subplots()
    sns.barplot(x='server number', y='qos', data=df, hue='algorithm', ax=ax)

    ax.set_xticklabels(['4', '11', '21', '36'])
    ax.set_xlabel('Server number', fontsize=16)
    ax.set_ylabel('Violation rate of deadline', fontsize=16)
    ax.set_ylim(0, 0.7)

    plt.xticks(fontsize=14)
    plt.yticks(fontsize=14)
    plt.legend(loc='lower center', ncol=3, framealpha=10, title='Algorithm', fontsize=12)
